import React from 'react';

const SlotM = (props) => {
    let x = props.x;
    let y = props.y;
    let z = props.z;

    if  (x === y && y === z) {
        return(
            <>
             <h1>This Is Maching</h1>
            </>
        )
    }
    else{
        return(
            <>
             <h1>This Not Maching</h1>
            </>
        )
    }
}
const App = () => {
    return(
         <>
          <h1> WeLcome To <span style={{fontWeight: "bold"}}>slat machine</span></h1>
          <SlotM x="a" y="a" z="a"/>
          <SlotM x="a" y="c" z="b"/>
          <SlotM x="a" y="d" z="a"/>
         </>

    
    )
}

export default App;
